import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

function App(){
    return(
    <div>
      <div>Podaj przebieg: <input type="number" name="przebieg"/></div>
      <div>Podaj ilość kilometrów: <input type="number" name="km"/></div>
    </div>
    );


}


ReactDOM.render(<App />, document.getElementById('root'));
